    false,nt"url": null,nt"notes": "In July 1985 two systematic aerial surveys
    were flown over the coastal fringe of the central Yukon-Kuskokwim Delta, Alaska,
    to examine the patterns of distribution of four species of geese during brood-rearing:
    Pacific black brant (Branta bernicla nigricans), cackling Canada geese (Branta canadensis
    minima), emperor geese (Chen canagica), and greater white-fronted geese (Anser albifrons).
    A second major objective was to develop a survey method to provide an annual index
    to the number of young produced in this major nesting area.",nt"license_title":
